export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:10}}},NBUMLtVxaS:{data:{id:1243,attributes:{imdbId:"tt3631112",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNzFlMjA0ZmUtZWI0Mi00ZGJkLTlmMmYtZmE1ODZiMjhjMGM0XkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.5\u002F10"},{Source:"Rotten Tomatoes",Value:"44%"},{Source:"Metacritic",Value:"48\u002F100"}],item_lang:{data:{id:1906,attributes:{title:d,plot:"The Girl on the Train is the story of Rachel Watson's life post-divorce. Every day, she takes the train in to work in New York, and every day the train passes by her old house. The house she lived in with her husband, who still lives there, with his new wife and child. As she attempts to not focus on her pain, she starts watching a couple who live a few houses down -- Megan and Scott Hipwell. She creates a wonderful dream life for them in her head, about how they are a perfect happy family. And then one day, as the train passes, she sees something shocking, filling her with rage. The next day, she wakes up with a horrible hangover, various wounds and bruises, and no memory of the night before. She has only a feeling: something bad happened. Then come the TV reports: Megan Hipwell is missing. Rachel becomes invested in the case and trying to find out what happened to Megan, where she is, and what exactly she herself was up to that same night Megan went missing.",slug:"the-girl-on-the-train"}}},books:{data:[{id:6862,attributes:{title:d,description:"The #1 New York Times Bestseller, USA Today Book of the Year, now a major motion picture starring Emily Blunt. The debut psychological thriller that will forever change the way you look at other people's lives, from the author of Into the Water and A Slow Fire Burning. “Nothing is more addicting than The Girl on the Train.”—Vanity Fair “The Girl on the Train has more fun with unreliable narration than any chiller since Gone Girl. . . . [It] is liable to draw a large, bedazzled readership.”—The New York Times “Marries movie noir with novelistic trickery. . . hang on tight. You'll be surprised by what horrors lurk around the bend.”—USA Today “Like its train, the story blasts through the stagnation of these lives in suburban London and the reader cannot help but turn pages.”—The Boston Globe “Gone Girl fans will devour this psychological thriller.”—People EVERY DAY THE SAME Rachel takes the same commuter train every morning and night. Every day she rattles down the track, flashes past a stretch of cozy suburban homes, and stops at the signal that allows her to daily watch the same couple breakfasting on their deck. She's even started to feel like she knows them. Jess and Jason, she calls them. Their life--as she sees it--is perfect. Not unlike the life she recently lost. UNTIL TODAY And then she sees something shocking. It's only a minute until the train moves on, but it's enough. Now everything's changed. Unable to keep it to herself, Rachel goes to the police. But is she really as unreliable as they say? Soon she is deeply entangled not only in the investigation but in the lives of everyone involved. Has she done more harm than good?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Udv-AwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2015-01-13",publisher:f,subtitle:g}},{id:6863,attributes:{title:d,description:"THE RUNAWAY SUNDAY TIMES NO.1 BESTSELLER AND THRILLER OF THE YEAR, NOW A MAJOR FILM STARRING EMILY BLUNT 'Really great suspense novel. Kept me up most of the night. The alcoholic narrator is dead perfect' STEPHEN KING Rachel catches the same commuter train every morning. She knows it will wait at the same signal each time, overlooking a row of back gardens. She's even started to feel like she knows the people who live in one of the houses. 'Jess and Jason', she calls them. Their life - as she sees it - is perfect. If only Rachel could be that happy. And then she sees something shocking. It's only a minute until the train moves on, but it's enough. Now everything's changed. Now Rachel has a chance to become a part of the lives she's only watched from afar. Now they'll see; she's much more than just the girl on the train...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=nfziDAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:e,published:"2016-01-01",publisher:"Random House",subtitle:i}},{id:6864,attributes:{title:d,description:"Adapted from Paula Hawkins' novel – an international phenomenon selling over twenty million copies worldwide – this gripping new play will keep you guessing until the final moment. Rachel Watson longs for a different life. Her only escape is the perfect couple she watches through the train window every day, happy and in love. Or so it appears. When Rachel learns that the woman she's been secretly watching has suddenly disappeared, she finds herself as a witness and even a suspect in a thrilling mystery.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Q6H8DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"2018-05-12",publisher:"Bloomsbury Publishing",subtitle:i}},{id:6865,attributes:{title:"A Slow Fire Burning",description:"AN INSTANT #1 NEW YORK TIMES BESTSELLER The scorching new thriller from the #1 New York Times bestselling author of The Girl on the Train. “A Slow Fire Burning twists and turns like a great thriller should, but it's also deep, intelligent and intensely human.” – Lee Child “Only a clairvoyant could anticipate the book’s ending” – New York Times With the same propulsion that captivated millions of readers worldwide in The Girl on the Train and Into the Water, Paula Hawkins unfurls a gripping, twisting story of deceit, murder, and revenge. When a young man is found gruesomely murdered in a London houseboat, it triggers questions about three women who knew him. Laura is the troubled one-night-stand last seen in the victim’s home. Carla is his grief-stricken aunt, already mourning the recent death of yet another family member. And Miriam is the nosy neighbor clearly keeping secrets from the police. Three women with separate connections to the victim. Three women who are – for different reasons – simmering with resentment. Who are, whether they know it or not, burning to right the wrongs done to them. When it comes to revenge, even good people might be capable of terrible deeds. How far might any one of them go to find peace? How long can secrets smolder before they explode into flame? Look what you started.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=af0LEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"2021-08-31",publisher:f,subtitle:g}},{id:6866,attributes:{title:"Into the Water",description:"#1 NEW YORK TIMES BESTSELLER GOODREADS CHOICE AWARD WINNER FOR MYSTERY\u002FTHRILLER An addictive novel of psychological suspense from the author of #1 New York Times bestseller and global phenomenon The Girl on the Train and A Slow Fire Burning. “Hawkins is at the forefront of a group of female authors . . who have reinvigorated the literary suspense novel by tapping a rich vein of psychological menace and social unease… there’s a certain solace to a dark escape, in the promise of submerged truths coming to light.” —Vogue A single mother turns up dead at the bottom of the river that runs through town. Earlier in the summer, a vulnerable teenage girl met the same fate. They are not the first women lost to these dark waters, but their deaths disturb the river and its history, dredging up secrets long submerged. Left behind is a lonely fifteen-year-old girl. Parentless and friendless, she now finds herself in the care of her mother's sister, a fearful stranger who has been dragged back to the place she deliberately ran from—a place to which she vowed she'd never return. With the same propulsive writing and acute understanding of human instincts that captivated millions of readers around the world in her explosive debut thriller, The Girl on the Train, Paula Hawkins delivers an urgent, twisting, deeply satisfying read that hinges on the deceptiveness of emotion and memory, as well as the devastating ways that the past can reach a long arm into the present. Beware a calm surface—you never know what lies beneath.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=mKhPEAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:e,published:"2017-05-02",publisher:f,subtitle:g}}]}}},meta:{}}},prerenderedAt:1688531371420}}("movie","Paula Hawkins","series","The Girl on the Train",null,"Penguin","A Novel",1,""))